import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import About from "./pages/About"
import ChatRoom from "./pages/ChatRoom"

function App() {
  return (
    <Router>
          <Routes>
              <Route exact path="/" element={<ChatRoom />} />
              <Route path = "/about" element = {<About />} />
          </Routes>
    </Router>
  );
}

export default App;
